import React from 'react';
import ContactForm from '../components/ContactForm';
import '../styles/ContactForm.css'; // Assuming ContactForm.css holds styles

const Contact = () => {
  return (
    <section className="contact">
      <h2>Contact</h2> {/* Heading for the contact section */}
      <p>If you have any questions or requests, please feel free to contact us using the form below. You can also send your resume for potential job opportunities.</p>
      <ContactForm /> {/* Contact form component */}
    </section>
  );
};

export default Contact;
